import{_ as e,c as t,a2 as s,o as r}from"./chunks/framework.DN5Ma_nw.js";const u=JSON.parse('{"title":"HBuilder使用模拟器调试","description":"","frontmatter":{},"headers":[],"relativePath":"study/knowledge/项目相关/HBuilder使用模拟器调试.md","filePath":"learn/study/knowledge/项目相关/HBuilder使用模拟器调试.md","lastUpdated":1733132188000}'),i={name:"study/knowledge/项目相关/HBuilder使用模拟器调试.md"};function l(d,a,p,n,h,o){return r(),t("div",null,a[0]||(a[0]=[s('<h1 id="hbuilder使用模拟器调试" tabindex="-1">HBuilder使用模拟器调试 <a class="header-anchor" href="#hbuilder使用模拟器调试" aria-label="Permalink to &quot;HBuilder使用模拟器调试&quot;">​</a></h1><h2 id="下载安装模拟器" tabindex="-1">下载安装模拟器 <a class="header-anchor" href="#下载安装模拟器" aria-label="Permalink to &quot;下载安装模拟器&quot;">​</a></h2><p>常见的安卓手机模拟器：</p><table tabindex="0"><thead><tr><th>手机模拟器名称</th><th>对应端口号</th></tr></thead><tbody><tr><td>夜神模拟器</td><td>62001</td></tr><tr><td>天天模拟器</td><td>6555</td></tr><tr><td>海马玩模拟器</td><td>26944</td></tr><tr><td>逍遥模拟器</td><td>21503</td></tr><tr><td>网易mumu模拟器</td><td>7555</td></tr></tbody></table><p>以网易mumu 为例 ，下载地址：<a href="http://mumu.163.com/" target="_blank" rel="noreferrer">http://mumu.163.com/</a></p><p>下载后直接安装即可。</p><h2 id="配置环境变量" tabindex="-1">配置环境变量 <a class="header-anchor" href="#配置环境变量" aria-label="Permalink to &quot;配置环境变量&quot;">​</a></h2><p>1）复制adb.exe所在文件夹目录</p><p>找到<a href="https://so.csdn.net/so/search?q=HBuilder&amp;spm=1001.2101.3001.7020" target="_blank" rel="noreferrer">HBuilder</a> X 的安装目录，查找adb.exe文件，复制adb.exe所在文件目录的路径，配置到环境变量的Path中。 <a href="https://imgse.com/i/pCHFaSP" target="_blank" rel="noreferrer"><img src="https://s1.ax1x.com/2023/07/20/pCHFaSP.png" alt="pCHFaSP.png" loading="lazy"></a> 2）打开控制面板—系统和安全—系统—高级系统设置—环境变量，界面如下： <a href="https://imgse.com/i/pCHF8dH" target="_blank" rel="noreferrer"><img src="https://s1.ax1x.com/2023/07/20/pCHF8dH.png" alt="pCHF8dH.png" loading="lazy"></a> 3）点击系统变量的Path 点击编辑后 ，把之前复制的adb.exe路径拷贝进来，点击保存。 <a href="https://imgse.com/i/pCHFlLD" target="_blank" rel="noreferrer"><img src="https://s1.ax1x.com/2023/07/20/pCHFlLD.png" alt="pCHFlLD.png" loading="lazy"></a></p><h2 id="安卓模拟器端口配置" tabindex="-1">安卓模拟器端口配置 <a class="header-anchor" href="#安卓模拟器端口配置" aria-label="Permalink to &quot;安卓模拟器端口配置&quot;">​</a></h2><p>点击Hbuilder的“运行”— 运行到手机或模拟器—Android模拟器端口设置。 <a href="https://imgse.com/i/pCHFMQK" target="_blank" rel="noreferrer"><img src="https://s1.ax1x.com/2023/07/20/pCHFMQK.png" alt="pCHFMQK.png" loading="lazy"></a></p><h2 id="使用adb命令连接手机模拟器并测试" tabindex="-1">使用adb命令连接手机模拟器并测试 <a class="header-anchor" href="#使用adb命令连接手机模拟器并测试" aria-label="Permalink to &quot;使用adb命令连接手机模拟器并测试&quot;">​</a></h2><p>首先，打开mumu手机模拟器，在HBuilder x 中查看能否检测到设备。 如果 HBuilder x 未检测到 模拟器，需要使用adb命令进行连接。</p><p>运行cmd，执行以下命令行查看 adb 的版本（测试是否能使用）</p><div class="language-powershell vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">powershell</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">adb version</span></span></code></pre></div><p>查看连接的设备</p><div class="language-powershell vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">powershell</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">adb devices</span></span></code></pre></div><p>使用adb命令 让模拟器连接上电脑</p><div class="language-powershell vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">powershell</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">adb connect </span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;">127.0</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">.</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;">0.1</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">:</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;">7555</span></span></code></pre></div><p>最后测试Hbuilder能否连接手机模拟器 <a href="https://imgse.com/i/pCHFnRx" target="_blank" rel="noreferrer"><img src="https://s1.ax1x.com/2023/07/20/pCHFnRx.png" alt="pCHFnRx.png" loading="lazy"></a></p><h2 id="adb报错" tabindex="-1">ADB报错 <a class="header-anchor" href="#adb报错" aria-label="Permalink to &quot;ADB报错&quot;">​</a></h2><p><a href="https://ask.dcloud.net.cn/question/155184" target="_blank" rel="noreferrer">https://ask.dcloud.net.cn/question/155184</a></p>',22)]))}const g=e(i,[["render",l]]);export{u as __pageData,g as default};
